{"code": "import PyPDF2

pdf_path = '/workspace/drinks_survey.pdf'

try:
    with open(pdf_path, 'rb') as f:
        reader = PyPDF2.PdfReader(f)
        text = ""
        for page in reader.pages:
            page_text = page.extract_text()
            text += page_text + "\n"
    print(text)
except Exception as e:
    print(f'Error: {e}')"}

